__d(function(g,r,i,a,m,e,d){"use strict";Object.defineProperty(e,'__esModule',{value:!0}),Object.defineProperty(e,"faqsMock",{enumerable:!0,get:function(){return n}});var n=[{question:"\xbfC\xf3mo funciona el sistema de filtraci\xf3n?",answer:"El sistema de filtraci\xf3n es el encargado de mantener el agua de la piscina limpia y cristalina.\nFunciona mediante una bomba que hace circular el agua a trav\xe9s de un filtro que retiene las\nimpurezas y eventualmente las env\xeda al desag\xfce auto limpiandose.\nPara activar el sistema de manera MANUAL, primero debe seleccionar las entradas de agua\n(Fondo, Skimmer, Barrefondo o Tanque de Compensaci\xf3n) y luego elegir el modo FILTRAR."},{question:"\xbfPara qu\xe9 sirven las diferentes entradas de agua?",answer:"   \u2022 Fondo: Aspira el agua desde el fondo de la piscina, recogiendo la suciedad que se flota\nen el sector bajo de la piscina.\n    \u2022 Skimmer: Recoge el agua de la superficie, eliminando hojas, insectos y otros elementos\nflotantes.\n    \u2022 Barrefondo: Se utiliza cuando conectamos un limpiafondos manual o autom\xe1tico para\naspirar la suciedad del fondo.\n    \u2022 Tanque de Compensaci\xf3n (T.C.): En piscinas desbordantes, recoge el agua que rebosa\npor los bordes y la devuelve filtrada en el sistema.\n\nPara activar una entrada, simplemente haga clic en el bot\xf3n correspondiente. Puede seleccionar\nvarias entradas simult\xe1neamente."},{question:"\xbfQu\xe9 hacen los diferentes modos de filtraci\xf3n? ",answer:"   \u2022 Filtrar: Es el modo normal de funcionamiento. El agua pasa a trav\xe9s del filtro para eliminar\nimpurezas y luego regresa a la piscina filtrada y desinfectada.\n    \u2022 Recircular: El agua circula sin pasar por el filtro. \xdatil \xfanicamente si se a\xf1aden productos\nqu\xedmicos que no deben pasar por el filtro.\n    \u2022 Retrolavar: Invierte el flujo de agua para limpiar el filtro, expulsando la suciedad\nacumulada dentro de \xe9l. Se debe realizar peri\xf3dicamente cuando la presi\xf3n aumenta.\n    \u2022 Desagotar: Env\xeda el agua directamente al desag\xfce sin pasar por el filtro. Se utiliza para\nvaciar parcialmente la piscina o eliminar agua muy sucia.\n\nPara activar un modo, primero seleccione las entradas de agua y luego pulse el bot\xf3n del modo\ndeseado en el panel de control de filtro."},{question:"\xbfQu\xe9 son los sistemas germicidas y c\xf3mo funcionan?",answer:"Los sistemas germicidas son dispositivos complementarios que ayudan a mantener el agua\nlimpia y libre de microorganismos. Su sistema cuenta con hasta tres tipos:\n    \u2022 Sistema UV: Utiliza luz ultravioleta para eliminar bacterias, virus y algas. El agua pasa a\ntrav\xe9s de una c\xe1mara con l\xe1mparas UV que destruyen los microorganismos.\n    \u2022 Ionizador de cobre: Libera iones de cobre en el agua que tienen propiedades alguicidas y\nbactericidas, reduciendo la necesidad de productos qu\xedmicos. Previene tanto como combate.\n    \u2022 Transductor ultras\xf3nico: Emite ondas ultras\xf3nicas que previenen la formaci\xf3n de algas y biofilm en las superficies de la piscina, y con ello el crecimiento de colonias de organismos\nalojados en rincones y ca\xf1er\xedas.\n\nEstos sistemas se activan autom\xe1ticamente cuando el filtro est\xe1 en modo \"Filtrar\" o \"Recircular\", pero se desactivan en los modos \"Retrolavar\" y \"Desagotar\" para proteger los equipos."},{question:"\xbfC\xf3mo programo los ciclos de filtraci\xf3n?",answer:"La programaci\xf3n de los ciclos de filtraci\xf3n se realiza en la pesta\xf1a \"Programaci\xf3n\". All\xed\nencontrar\xe1 un calendario semanal donde puede configurar los horarios de funcionamiento del\nsistema.\nSeleccione los d\xedas de la semana en los que desea que funcione el sistema.\nConfigure las horas de inicio y finalizaci\xf3n para cada d\xeda.\nGuarde la configuraci\xf3n pulsando el bot\xf3n correspondiente.\nSe recomienda programar al menos entre 6 y 8 horas diarias de filtraci\xf3n en verano (3 ciclos\ndiarios de 2:30 hs cada uno) y 4 horas en invierno, preferiblemente divididas en dos ciclos."},{question:"\xbfCu\xe1ndo debo realizar el retrolavado del filtro?",answer:"El retrolavado debe realizarse cuando la presi\xf3n del filtro aumente a 1 bar, lo que indica que el\nfiltro est\xe1 obstruido por la suciedad acumulada.\nPara realizar un retrolavado:\nDetenga la bomba si est\xe1 en funcionamiento.\nSeleccione la entrada de agua \"Fondo\"\nActive el modo \"Retrolavar\" en el panel de control.\nEl sistema comenzara a hacer un lavado interno del filtro enviando al desgaste los restos de\nsuciedad que estan obstruyendo un buen filtrado, esta operaci\xf3n puede durar hasta 2 minutos.\nSeguido har\xe1 un ENJUAGUE del mismo para asegurarse que no queden restos en las ca\xf1er\xedas,\nesto tomara solo 10 segundos. Luego su equipo de filtrado estar\xe1 listo para operar normalmente\ncon mas eficacia."}]},1797,[]);
